import React, { Component } from "react";
import "./App.scss";

import { Parser } from "html-to-react";

const rawHTML = `
 		<div id="form-params-cond-po">
			<div class="govuk-form-group" id="form-params-cond-po"><label class="govuk-label"
					for="ziadost-param-stat"><span>Štát</span></label><select class="govuk-select" id="ziadost-param-stat"
					name="ziadost-param-stat">
					<option value="SK" selected>Slovenská republika</option>
					<option value="CZ">Česká republika</option>
					<option value="PL">Poľská republika</option>
				</select></div>
			<div class="govuk-form-group" id="form-params-cond-po"><label class="govuk-label"
					for="ziadost-param-ico"><span>IČO</span></label><input class="govuk-input" id="ziadost-param-ico"
					name="ziadost-param-ico" value="12345678"></div>
		</div>
`;

function App() {
	return (
		<div style={container}>
			<form>{Parser().parse(rawHTML)}</form>
		</div>
	);
}

const container = {
	width: 800,
	margin: "auto",
};

export default App;
